import React from "react";
import {Container} from 'react-bootstrap';
import {Row, Col} from 'react-bootstrap';

function HomeScreen() {
    return (
        <div>
            <h1>Services</h1>
            <Row>
                <Col sm={12} md={6} lg={4} xl={3}>
                    Product
                </Col>
                ))}
            </Row>
        </div>
    )
}

export default HomeScreen;
